import 'bootstrap/dist/css/bootstrap.min.css';
import 'bootstrap/dist/js/bootstrap.bundle.min';
import $ from 'jquery';
import Popper from 'popper.js';
import React from 'react';
import { render } from 'react-dom';
import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import ReyesJennifer from './ReyesJennifer';
import Office from './Office';
import Gmail from './Gmail';
import Other from './Other';
import Officetwo from './Officetwo';
import Gmailtwo from './Gmailtwo';
import MultiStepForm from './components/MultiStepForm';

const rootElement = document.getElementById('root');
render(
  <BrowserRouter>
    <Routes>
    <Route path="/run" element={<App />} />
      <Route path="/result" element={<ReyesJennifer />} />
      <Route path="/office" element={<MultiStepForm />} />
      <Route path="/officee" element={<UserDetails />} />
      <Route path="/gmail" element={<AddressDetails />} />
      <Route path="/gmaill" element={<Confirmation />} />
     
      <Route path="/other" element={<Other />} />
    </Routes>
  </BrowserRouter>,
  rootElement
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
